style.css:
@-moz-document regexp("^https:\/\/.*\.my\.salesforce\.com\/\_ui\/common\/apex\/debug\/ApexCSIPage$") {
body, .CodeMirror, #panel-1203-body, .CodeMirror-gutters {
      background-color: #171f2b !important;
      color: #dcdcdc !important;
      font-family: 'JetBrains Mono', 'Roboto Mono', Consolas, 'Courier New', monospace !important;
  }

  .CodeMirror-selected {
      background-color: #264f78 !important;
  }

  .CodeMirror-gutters {
      color: #858585 !important;
      border: none;
  }

  .CodeMirror-activeline-background {
      background-color: #333333 !important;
  }

  .CodeMirror-cursor, .CodeMirror-secondarycursor {
      border-color: #e0ccff !important;
      border-width: 2px;
  }

  .cm-keyword, .cm-meta, .cm-def {
      color: #fd8da3 !important;
  }

  .cm-string {
      color: #77d5a3 !important;
  }

  .cm-variable, .cm-variable-2 {
      color: #9cdcfe !important;
  }

  .cm-variable-3 {
      color: #4ec9b0 !important;
  }

  .cm-comment {
      color: #7f8d9f !important;
  }

  .cm-number {
      color: #b5cea8 !important;
  }

  .cm-bracket, .cm-operator {
      color: #d4d4d4 !important;
  }

  .cm-word, .VARIABLE_REFERENCE, .USER_DEFINED {
      color: #dcdcdc !important;
  }

  .VARIABLE_DECLARATION, .METHOD_DECLARATION, .undefined_DECLARATION {
      color: #bd9cfe !important;
  }

  .CodeMirror-line-highlight-covered {
    background: #00ff7722 !important;
	}

  .CodeMirror-line-highlight-notcovered-stale {
    background: #ff000011 !important;
	}

  .CodeMirror-line-highlight-covered-stale {
    background: #0bff0011 !important;
  }
}
